import React, { Component } from 'react';
import '../../index.css';

class DataBasePage extends Component{
  constructor(){
    super();
    this.state = {
      customers: []
    }
  }

  componentDidMount(){
    fetch('/api/customers')
    .then(res => res.json())
    .then(customers => this.setState({customers}, () => console.log('Customers fetched..',
    customers)));
  }
  render(){
    return(
      <div>
        <h2>
          Customers
        </h2>
      </div>
    );
  }
}

export default DataBasePage;
